import React from "react";

class StatefulGreeting extends React.Component {

constructor(props) {
  super(props);
  this.state = {
    introduction: "Hello",
    buttonText: "Exit",
  };
}


  render() {
    return (
      <div>
        <h1>(this.state.introd) (this.props.greeting)</h1>
        <button></button>
      </div>
    )
  }
}

export default StatefulGreeting;
